import React from 'react';
import {useSelector} from "react-redux";
import {start} from "../../actions/history";

const History = () => {
    start();
    const history = useSelector(state=>state.app.history);
    console.log(history);
    return (
        <div>
            <table>
                <thead className={"text-center"}>
                    <th>â„–</th>
                    <th>Kind</th>
                    <th>Right answers</th>
                    <th>Total answers</th>
                </thead>
            {
                history.map((item,index)=>{
                    return (
                        <tr className={"text-center"}>
                            <td>{index+1}</td>
                            <td>{item.kind}</td>
                            <td>{item.rightAnswers}</td>
                            <td>{item.totalAnswers}</td>
                            <td>{item.date}</td>
                        </tr>
                    )
                })
            }
            </table>
        </div>
    );
};

export default History;
